<!DOCTYPE html>
<html lang="en">
<meta charset="UTF-8">
<meta http-equiv="X-UA-Compatible" content="IE=edge">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>Report</title>
<link rel="shortcut icon" href="">
<link rel="stylesheet" href="/static/assets/bootstrap.min.css">
<style lang="scss">
  * {
    font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif,
      "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol";
    box-sizing: border-box;
    margin: 0;
    padding: 0;
  }

  html,
  body {
    height: 100%;
    width: 100%;
  }

  img {
    vertical-align: middle;
  }

  .m-r-10 {
    margin-right: 10px;
  }

  #root {
    display: block;
    height: 100%;
    width: 100%;
    background-image: linear-gradient(to bottom, rgba(240, 244, 255, .5) 0, #fff 100%);
    overflow: auto;
  }

  .content-limit {
    padding-left: 12vw;
    padding-right: 12vw;
    min-width: 1280px;
  }

  .header {
    width: 100%;
    background-color: #fff;
    display: flex;
    align-items: center;
    justify-content: space-between;
    min-height: 60px;
    position: relative;
    top: 0;
    left: 0;
    z-index: 1;
  }
  .header.header-shadow{
    box-shadow: 0 2px 4px -4px rgba(31,35,41,.02),0 2px 4px rgba(31,35,41,.02),0 2px 8px 2px rgba(31,35,41,.03);
  }

  .header-title {
    display: flex;
    flex-direction: row;
    align-items: center;
  }

  .header-contact {
    align-items: center;
    color: #1f2329;
    display: flex;
    margin: 0 16px;
    position: relative;
    text-decoration: none;

    svg {
      margin-right: 8px;
    }
  }

  .app-container {
    display: flex;
    flex-direction: row;
    gap: 10px;
    width: 100%;
    height: max-content;
    position: relative;
    color: #1f2329;
    padding-top: 10px;
    padding-bottom: 10px;
  }

  .app-content {
    flex: 1;
  }

  .app-menu {
    width: 180px;
  }

  .copyright-list {
    position: fixed;
    left: 0;
    right: 0;
    bottom: 0;

    background-color: #f5f6f7;
    color: #646a73;
    font-size: 12px;
    line-height: 36px;
    margin: 0 auto;
    padding: 8px 48px;
    text-align: center;
  }
</style>
</head>
